-- Function to create notifications at the BOTTOM-RIGHT
local function showNotification(text, iconId)
    local NotificationFrame = Instance.new("Frame")
    local NotificationCorner = Instance.new("UICorner")
    local NotificationIcon = Instance.new("ImageLabel")
    local NotificationText = Instance.new("TextLabel")
    
    -- BOTTOM-RIGHT positioning (100px above bottom)
    NotificationFrame.Parent = ScreenGui
    NotificationFrame.BackgroundColor3 = Color3.fromRGB(0, 0, 0)
    NotificationFrame.Size = UDim2.new(0, 300, 0, 60)
    NotificationFrame.Position = UDim2.new(1, -320, 1, -100)
    NotificationFrame.BorderSizePixel = 0

    -- Rounded Corners
    NotificationCorner.Parent = NotificationFrame
    NotificationCorner.CornerRadius = UDim.new(0, 8)

    -- Notification Icon
    NotificationIcon.Parent = NotificationFrame
    NotificationIcon.Size = UDim2.new(0, 30, 0, 30)
    NotificationIcon.Position = UDim2.new(0, 10, 0.5, -15)
    NotificationIcon.BackgroundTransparency = 1
    NotificationIcon.Image = iconId -- Dynamic icon ID

    -- Notification Text
    NotificationText.Parent = NotificationFrame
    NotificationText.Text = text
    NotificationText.Size = UDim2.new(1, -60, 1, 0)
    NotificationText.Position = UDim2.new(0, 50, 0, 0)
    NotificationText.TextColor3 = Color3.fromRGB(255, 255, 255)
    NotificationText.BackgroundTransparency = 1
    NotificationText.TextWrapped = true
    NotificationText.Font = Enum.Font.SourceSansBold
    NotificationText.TextSize = 14
    NotificationText.TextXAlignment = Enum.TextXAlignment.Left

    -- Auto-remove after 5 seconds
    task.wait(5)
    NotificationFrame:Destroy()
end

-- Show ℹ️ info notification when "Activate" is clicked
ActivateButton.MouseButton1Click:Connect(function()
    showNotification("Successfully Run!\nPlease Make Sure You Have A Good PC To Run This Script Perfectly!", "rbxassetid://86045553797238")
end)

-- Show ✅ check notification when "Anti-Banned Bypass" is clicked
BypassButton.MouseButton1Click:Connect(function()
    showNotification("Anti-Banned Protection Has Been Activated!\nYour Account is Safe Now.", "rbxassetid://79444735405977")
end)

